DELIMITER $$
CREATE TRIGGER `SET_DEFAULT_NAME` BEFORE INSERT ON `users` FOR EACH ROW BEGIN
    DECLARE next_id INT;
    SET next_id = (SELECT AUTO_INCREMENT FROM information_schema.TABLES WHERE TABLE_SCHEMA=DATABASE() AND TABLE_NAME='users');
    IF NEW.username IS NULL OR NEW.username = '' THEN
        SET NEW.username = CONCAT('user', next_id);
    END IF;
END
$$
